import React, { useState } from 'react';
import {
  Container, Typography, TextField, Button, Grid, Paper, Box, Link
} from '@mui/material';
import { useNavigate } from 'react-router-dom';

const RegisterPage = () => {
  const navigate = useNavigate();
  const [formData, setFormData] = useState({
    first_name: '',
    last_name: '',
    email: '',
    password: '',
    address: '',
    phone_number: '',
    travel_interests: '',
    dob: '',
  });

  const handleChange = (e) => {
    setFormData({ ...formData, [e.target.name]: e.target.value });
  };

  const handleRegister = async () => {
    try {
      const response = await fetch('http://localhost:5000/register', {
        method: 'POST',
        headers: { 'Content-Type': 'application/json' },
        body: JSON.stringify(formData),
      });

      if (!response.ok) {
        const err = await response.json();
        throw new Error(err.error || 'Registration failed');
      }

      alert('Registration successful! Please log in.');
      navigate('/login');
    } catch (error) {
      console.error('Registration error:', error);
      alert(error.message);
    }
  };

  return (
    <Container maxWidth="sm">
      <Paper elevation={4} sx={{ padding: 4, marginTop: 8 }}>
        <Typography variant="h5" align="center" gutterBottom>
          Create an Account
        </Typography>
        <Grid container spacing={2}>
          <Grid item xs={6}>
            <TextField fullWidth name="first_name" label="First Name" value={formData.first_name} onChange={handleChange} />
          </Grid>
          <Grid item xs={6}>
            <TextField fullWidth name="last_name" label="Last Name" value={formData.last_name} onChange={handleChange} />
          </Grid>
          <Grid item xs={12}>
            <TextField fullWidth name="email" label="Email" value={formData.email} onChange={handleChange} />
          </Grid>
          <Grid item xs={12}>
            <TextField fullWidth name="password" label="Password" type="password" value={formData.password} onChange={handleChange} />
          </Grid>
          <Grid item xs={12}>
            <TextField fullWidth name="address" label="Address" value={formData.address} onChange={handleChange} />
          </Grid>
          <Grid item xs={12}>
            <TextField fullWidth name="phone_number" label="Phone Number" value={formData.phone_number} onChange={handleChange} />
          </Grid>
          <Grid item xs={12}>
            <TextField fullWidth name="travel_interests" label="Travel Interests" value={formData.travel_interests} onChange={handleChange} />
          </Grid>
          <Grid item xs={12}>
            <TextField
              fullWidth
              name="dob"
              label="Date of Birth"
              type="date"
              InputLabelProps={{ shrink: true }}
              value={formData.dob}
              onChange={handleChange}
            />
          </Grid>
        </Grid>
        <Box mt={3} display="flex" justifyContent="space-between" alignItems="center">
          <Button variant="contained" onClick={handleRegister}>
            Register
          </Button>
          <Link component="button" variant="body2" onClick={() => navigate('/login')}>
            I already have an account
          </Link>
        </Box>
      </Paper>
    </Container>
  );
};

export default RegisterPage;
